import React from "react";

const Footer = () => {
    return (
        <footer className="footer">
            <div className="scrolling-text">
                <p> Parašykite man - Parašykite man - Parašykite man - Parašykite man - Parašykite man - Parašykite man</p>
            </div>
            <div className="social-icons">
                <a href="#">M</a>
                <a href="#">F</a>
                <a href="#">I</a>
                <P>© 2024.</P>
            </div>
        </footer>
    );
};

export default Footer;
